-- Table structure for t_his_inhospital_order
-- ----------------------------
DROP TABLE IF EXISTS `t_his_inhospital_order`;
CREATE TABLE `t_his_inhospital_order` (
  `inhospital_order_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `platform_id` bigint(20) DEFAULT NULL COMMENT '平台编号',
  `his_id` bigint(20) DEFAULT NULL COMMENT '医院编号',
  `user_id` bigint(20) DEFAULT NULL COMMENT '用户编号',
  `patient_id` bigint(20) DEFAULT NULL,
  `user_mobile` varchar(20) DEFAULT NULL,
  `platform_source` int(11) DEFAULT NULL COMMENT '（1-微信 2-支付宝 3-app）',
  `sub_source` int(19) DEFAULT '0' COMMENT '子渠道',
  `pay_status` int(11) DEFAULT '0' COMMENT '0->未支付  1->已支付',
  `status` char(2) DEFAULT NULL COMMENT '订单状态（U：初始预登记;P：付款完成，调用医院支付接口中;A：订单成功;H：调用医院支付接口异常;Z：调用医院支付接口异常，重发次数超限;C：已取消;）',
  `pay_type` varchar(64) DEFAULT NULL COMMENT '支付方式参考t_payc_mode_info',
  `payed_time` datetime DEFAULT NULL COMMENT '支付时间',
  `inhospital_no` varchar(40) DEFAULT NULL,
  `his_name` varchar(20) DEFAULT NULL COMMENT '医院名称',
  `dept_id` varchar(20) DEFAULT NULL COMMENT '科室编号',
  `dept_name` varchar(20) DEFAULT NULL COMMENT '住院科室',
  `bed_no` varchar(20) DEFAULT NULL COMMENT '病床号',
  `inhospital_area` varchar(100) DEFAULT '' COMMENT '住院区域',
  `his_order_no` varchar(50) DEFAULT NULL COMMENT '医院交易流水号',
  `pay_fee` int(11) DEFAULT NULL COMMENT '支付金额',
  `acquirer_no` varchar(30) DEFAULT NULL COMMENT '收单机构流水号',
  `patient_name` varchar(20) DEFAULT NULL COMMENT '病人姓名',
  `patient_mobile` varchar(20) DEFAULT NULL COMMENT '病人电话',
  `id_type` int(11) DEFAULT NULL COMMENT '证件类型（1-身份证 2-港澳居民身份证 3-台湾居民身份证 4-护照）',
  `id_no` varchar(20) DEFAULT NULL COMMENT '证件号',
  `pat_card_type` int(11) DEFAULT NULL COMMENT '医院卡类型',
  `pat_card_no` varchar(30) DEFAULT NULL COMMENT '医院卡编号',
  `refund_status` int(2) DEFAULT '0' COMMENT '是否退款状态（0-否 1-是）',
  `admission_num` varchar(255) DEFAULT NULL COMMENT '住院号',
  `sync_status` int(11) DEFAULT '0' COMMENT '0.未同步  1.同步成功 2.同步失败 3.同步异常',
  `renotice_num` int(4) DEFAULT '0' COMMENT '发送次数',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后修改日期',
  `error_msg` varchar(254) DEFAULT NULL COMMENT '失败错误信息',
  `ext_fields` varchar(254) DEFAULT NULL COMMENT '拓展属性',
  `his_serial_no` varchar(100) DEFAULT NULL COMMENT '医院流水号',
  `his_recepit_no` varchar(100) DEFAULT NULL COMMENT '医院收据号',
  `pay_order_id` bigint(19) DEFAULT NULL COMMENT '支付订单号',
  `system_type` int(2) DEFAULT '0' COMMENT '系统类型 0:未知 1：window   2:android',
  `his_status` varchar(2) DEFAULT NULL COMMENT '医院支付状态',
  `dev_id` varchar(32) DEFAULT NULL COMMENT '设备id',
  PRIMARY KEY (`inhospital_order_id`),
  KEY `idx_inho_patCardNo` (`pat_card_no`),
  KEY `idx_inho_agtOrdNum` (`acquirer_no`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='住院订单表';

