DROP TABLE IF EXISTS `t_his_inhospital_order_sync`;
CREATE TABLE `t_his_inhospital_order_sync` (
  `inhospital_order_sync_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `order_id` bigint(19) DEFAULT NULL COMMENT '订单id',
  `object_id` bigint(19) DEFAULT NULL COMMENT '对象id（订单，退款单）',
  `system_name` varchar(50) DEFAULT NULL COMMENT '同步系统或模块名称（支付pay，等等）',
  `type` varchar(20) DEFAULT NULL COMMENT '发送类型',
  `biz_type` varchar(255) DEFAULT NULL COMMENT '业务类型',
  `status` int(2) DEFAULT NULL COMMENT '状态，是否成功（0-否 1-是）',
  `times` int(4) DEFAULT NULL COMMENT '发送次数',
  `send_time` datetime DEFAULT NULL COMMENT '发送时间',
  `memo` varchar(255) DEFAULT NULL COMMENT '备注',
