  PRIMARY KEY (`inhospital_order_sync_id`),
  KEY `rc_index_orderlog_orderid` (`order_id`) USING BTREE,
  KEY `rc_index_orderlog_condition` (`order_id`,`object_id`,`system_name`,`type`) USING BTREE COMMENT '查询组合唯一约束'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单同步状态表';

