DROP TABLE IF EXISTS `t_his_oppay_error_order`;
CREATE TABLE `t_his_oppay_error_order` (
  `order_id` bigint(11) NOT NULL COMMENT '订单id',
  `his_id` bigint(20) NOT NULL COMMENT '医院id',
  `channel` int(11) NOT NULL COMMENT '渠道',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '异常状态[0:异常状态；1:非异常状态]',
  `agt_ord_num` varchar(100) DEFAULT NULL COMMENT '收单机构流水号',
  `patient_id` bigint(20) DEFAULT NULL COMMENT '就诊人id',
  `patient_name` varchar(30) DEFAULT NULL COMMENT '就诊人姓名',
  `bus_type` varchar(20) NOT NULL COMMENT '业务类型[appointment_register:预约挂号；current_register:当班挂号；outpatient:门诊缴费;inpatient:住院押金补缴]',
  `reason` varchar(255) DEFAULT NULL COMMENT '异常原因',
  `his_order_no` varchar(100) DEFAULT NULL COMMENT '医院订单id 医院的编号',
  `inhospital_no` varchar(50) DEFAULT NULL COMMENT '住院号',
  `his_card_no` varchar(50) DEFAULT NULL COMMENT '就诊卡号',
  `his_card_type` varchar(50) DEFAULT NULL COMMENT '就诊卡类型',
  `pay_mode` varchar(50) DEFAULT NULL COMMENT '支付方式',
  `order_fee` int(11) NOT NULL DEFAULT '0' COMMENT '订单金额',
  `pay_time` datetime DEFAULT NULL COMMENT '缴费时间',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP,
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

