DROP TABLE IF EXISTS `t_his_oppay_order`;
CREATE TABLE `t_his_oppay_order` (
  `oppay_order_id` bigint(19) NOT NULL AUTO_INCREMENT COMMENT '门诊缴费id号',
  `platform_id` bigint(10) DEFAULT NULL COMMENT '平台id',
  `his_order_no` varchar(1000) DEFAULT NULL COMMENT '医院订单号',
  `name` varchar(100) NOT NULL COMMENT '缴费项目名称',
  `his_id` bigint(20) DEFAULT NULL COMMENT '医院id',
  `dept_id` varchar(50) DEFAULT NULL COMMENT '科室id',
  `doctor_id` varchar(20) DEFAULT NULL COMMENT '医生id',
  `his_name` varchar(100) NOT NULL COMMENT '医院名称',
  `dept_name` varchar(100) DEFAULT NULL COMMENT '科室名称',
  `doctor_name` varchar(100) DEFAULT NULL COMMENT '医生名称',
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `patient_id` bigint(20) DEFAULT NULL COMMENT '就诊人Id',
  `pay_type` varchar(64) DEFAULT NULL COMMENT '支付方式参考t_payc_mode_info',
  `payed_time` datetime DEFAULT NULL COMMENT '支付时间',
  `agt_ord_num` varchar(100) DEFAULT NULL COMMENT '收单机构流水号',
  `pay_status` int(2) DEFAULT '0' COMMENT '是否已支付（0-否 1-是）',
  `platform_source` int(4) DEFAULT NULL COMMENT '渠道来源（1-微信 2-支付宝 3-app)',
  `sub_source` int(19) DEFAULT '0' COMMENT '子渠道',
  `status` varchar(2) DEFAULT NULL COMMENT '订单状态（U：初始预登记;P：付款完成，调用医院支付接口中;S：付款完成，医院确认成功;F：缴费失败;H：付款完成，医院确认超时或出现故障）',
  `refund_status` int(2) DEFAULT '0' COMMENT '退款状态（0-没退款 1-有退款）',
  `total_real_fee` int(12) DEFAULT '0' COMMENT '实际支付金额',
  `total_fee` int(12) DEFAULT '0' COMMENT '订单总金额',
  `patient_name` varchar(50) NOT NULL COMMENT '就诊人名称',
  `patient_id_type` int(2) DEFAULT NULL COMMENT '就诊人证件id类型（1：二代身份证 2：港澳居民身份证 3：台湾居民身份证 4：护照 ）',
  `patient_id_no` varchar(50) DEFAULT NULL COMMENT '就诊人证件号',
  `patient_sex` varchar(2) DEFAULT NULL COMMENT '就诊人性别',
  `patient_age` int(3) DEFAULT NULL COMMENT '就诊人年龄',
  `patient_mobile` varchar(20) DEFAULT NULL COMMENT '就诊人电话号码',
  `his_serial_no` varchar(100) DEFAULT NULL COMMENT '医院流水号',
  `his_recepit_no` varchar(100) DEFAULT NULL COMMENT '医院收据号',
  `pat_card_type` varchar(10) DEFAULT NULL COMMENT '就诊卡类型',
  `pat_card_no` varchar(64) NOT NULL COMMENT '就诊卡号码',
  `his_refund_balance_no` varchar(50) DEFAULT NULL COMMENT '医院退费结算单号',
  `guide_info` varchar(500) DEFAULT NULL COMMENT '导诊信息',
  `medical_fee` int(12) DEFAULT '0' COMMENT '医保支付金额',
  `self_fee` int(12) DEFAULT '0' COMMENT '个人支付金额',
  `med_register_no` varchar(100) DEFAULT NULL COMMENT '医保就诊登记号',
  `is_zhima` int(2) DEFAULT NULL COMMENT '是否芝麻信用（0-否 1-是）',
  `dev_id` varchar(32) DEFAULT NULL COMMENT '设备id',
  `is_auto_refund` int(2) DEFAULT NULL COMMENT '是否自动退款（0-否 1-是）',
  `sec_id` varchar(50) DEFAULT NULL COMMENT '二维码id',
  `his_order_time` datetime DEFAULT NULL COMMENT '医院门诊订单开单时间',
  `charge_type` varchar(20) DEFAULT NULL COMMENT '费用类型-各医院自定义',
  `prescription_type` varchar(20) DEFAULT NULL COMMENT '处方类型-各医院自定义',
  `parent_his_id` bigint(20) DEFAULT NULL COMMENT '父医院ID',
  `pat_his_no` varchar(50) DEFAULT NULL COMMENT '就诊人门诊ID',
  `ext_fields` varchar(2000) DEFAULT NULL COMMENT '扩展字段,json格式',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `pay_order_id` bigint(20) DEFAULT NULL COMMENT '支付订单号',
  `his_bill_no` varchar(50) DEFAULT NULL COMMENT '医院的门诊流水号',
  `medical_param` varchar(2000) DEFAULT NULL COMMENT '医保支付参数',
  `medical_flag` int(2) DEFAULT NULL COMMENT '医保标识：1-自费 2-全医保 3-医保+自费',
  `error_msg` varchar(255) DEFAULT NULL COMMENT '错误信息',
  `system_type` int(2) DEFAULT '0' COMMENT '系统类型 0:未知 1：window   2:android',
  `merchant_order_id` varchar(50) DEFAULT NULL COMMENT '商户订单号',
  `his_status` varchar(2) DEFAULT '' COMMENT '医院支付状态',
  PRIMARY KEY (`oppay_order_id`),
  KEY `index_op_order_userid` (`user_id`) USING BTREE,
  KEY `idx_opp_patCardNo` (`pat_card_no`),
  KEY `idx_opp_agtOrdNum` (`agt_ord_num`)
) ENGINE=InnoDB AUTO_INCREMENT=129 DEFAULT CHARSET=utf8 COMMENT='门诊缴费订单表';

