DROP TABLE IF EXISTS `t_hospital_his`;
CREATE TABLE `t_hospital_his` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `alias` char(20) DEFAULT NULL COMMENT '别名',
  `name` varchar(100) DEFAULT NULL COMMENT '医院名称',
  `province_no` varchar(5) DEFAULT NULL COMMENT '医院所属省份代码',
  `city_no` varchar(4) DEFAULT NULL COMMENT '医院所属城市代码',
  `area_no` varchar(6) DEFAULT NULL COMMENT '医院所在区域代码',
  `type` int(1) DEFAULT '1' COMMENT '0:非最底层（说明它有子院）1：最底层（说明它没有子院，默认值）',
  `parent_his_no` varchar(12) DEFAULT '0' COMMENT '0：无上级医院',
  `address` varchar(100) DEFAULT NULL COMMENT '医院详细地址',
  `tel_no` varchar(50) DEFAULT NULL COMMENT '医院电话',
  `website` varchar(50) DEFAULT NULL,
  `level` int(2) DEFAULT NULL COMMENT '医院等级：\r\n11：一级甲等医院\r\n12：一级乙等医院\r\n13：一级丙等医院\r\n21：二级甲等医院\r\n22：二级乙等医院\r\n23：二级丙等医院\r\n31：三级甲等医院\r\n32：三级乙等医院\r\n33：三级丙等医院\r\n',
  `level_name` varchar(50) DEFAULT '' COMMENT '医院等级名称',
  `contacts` varchar(32) DEFAULT NULL COMMENT '医院联系人',
  `contacts_phone_no` varchar(11) DEFAULT '' COMMENT '医院联系人',
  `contacts_email` varchar(60) DEFAULT '' COMMENT '联系人邮箱',
  `introduction` mediumtext COMMENT '医院简介',
  `img_path` varchar(200) DEFAULT NULL COMMENT '医院图片路径',
  `floor_img_path` varchar(200) DEFAULT NULL COMMENT '医院楼层分布图',
  `traffic_img_path` varchar(200) DEFAULT NULL COMMENT '来院交通图地址',
  `reg_tel` varchar(11) DEFAULT NULL COMMENT '门诊预约电话',
  `longitude` varchar(11) DEFAULT NULL COMMENT '经度',
  `latitude` varchar(11) DEFAULT NULL COMMENT '维度',
  `logo_url` varchar(200) DEFAULT NULL COMMENT '医院logo地址',
  `py_initials` varchar(1) DEFAULT NULL COMMENT '拼音首字母',
  `tag` varchar(500) DEFAULT '' COMMENT '标签',
  `regster_limit_days` int(11) DEFAULT NULL COMMENT '预约挂号天数',
  `regster_time_out` int(11) DEFAULT NULL COMMENT '号源过期时间：秒',
  `rank` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  `ext_fields` varchar(1000) DEFAULT NULL COMMENT '扩展字段,json格式',
  PRIMARY KEY (`id`),
  UNIQUE KEY `alias` (`alias`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

