CREATE TABLE `t_payment_merchant` (
  `inside_merchant_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '内部商户ID',
  `inside_merchant_name` varchar(50) DEFAULT NULL COMMENT '内部商户名',
  `status` int(1) DEFAULT '1' COMMENT '使用状态（1-正常使用 2-暂停使用）',
  `pay_channel` varchar(32) DEFAULT NULL COMMENT '支付渠道',
  `merchant_id` varchar(50) NOT NULL COMMENT '商户id',
  `service_merchant_id` varchar(50) DEFAULT NULL COMMENT '服务商id',
  `merchant_name` varchar(100) DEFAULT NULL COMMENT '商户名称',
  `app_id` varchar(50) DEFAULT NULL COMMENT '商户appId',
  `service_app_id` varchar(50) DEFAULT NULL COMMENT '服务商appId',
  `merchant_account` varchar(50) DEFAULT NULL COMMENT '商户账号（wap版本有用）',
  `payment_key` varchar(128) DEFAULT NULL COMMENT '支付key',
  `med_payment_key` varchar(128) DEFAULT NULL COMMENT '医保支付秘钥',
  `app_secret` varchar(200) DEFAULT NULL COMMENT '公众号appSecret',
  `public_key` varchar(2000) DEFAULT NULL COMMENT '生活号公钥',
  `private_key` varchar(2000) DEFAULT NULL COMMENT '私钥',
  `med_org_no` varchar(50) DEFAULT NULL COMMENT '医院的医疗机构编码',
  `merchant_version` varchar(10) DEFAULT NULL COMMENT '商户版本号',
  `switchs` char(10) DEFAULT '0000000000' COMMENT '业务规则开关（第一位，是否限制使用信用卡：0-限制、1-不限制）',
  `component_appid` varchar(64) DEFAULT NULL COMMENT '第三方开发者appid',
  `authorizer_access_token` varchar(500) DEFAULT NULL COMMENT '授权Token',
  `provider_id` varchar(64) DEFAULT NULL COMMENT '业务商编号',
  `ext_fields` varchar(6000) DEFAULT NULL COMMENT '扩展字段',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`inside_merchant_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2149611490593035331 DEFAULT CHARSET=utf8 COMMENT='商户表';

-- ----------------------------
-- Records of t_payment_merchant
-- ----------------------------

-- ----------------------------
-- Table structure for t_payment_merchant_mode_rela
-- ----------------------------
DROP TABLE IF EXISTS `t_payment_merchant_mode_rela`;
CREATE TABLE `t_payment_merchant_mode_rela` (
  `his_id` bigint(20) NOT NULL COMMENT '医院ID',
  `biz_channel` varchar(32) NOT NULL COMMENT '业务来源',
  `biz_type` varchar(32) NOT NULL COMMENT '业务类型',
  `pay_mode` varchar(32) NOT NULL COMMENT '支付模式',
  `status` int(1) DEFAULT '1' COMMENT '状态（1-正常使用 2-暂停使用）',
  `inside_merchant_id` bigint(20) DEFAULT NULL COMMENT '内部商户id',
  `pay_mode_name` varchar(100) DEFAULT NULL COMMENT '个性化的支付名称',
  `logo_uri` varchar(128) DEFAULT NULL COMMENT '个性化的loguri',
  `sort` int(4) DEFAULT NULL COMMENT '排序',
  `ext_fields` varchar(1000) DEFAULT NULL COMMENT '扩展字段',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`his_id`,`biz_channel`,`biz_type`,`pay_mode`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='支付方式对应商户的关系表';

