-- ----------------------------
-- Table structure for t_payment_method
-- ----------------------------
DROP TABLE IF EXISTS `t_payment_method`;
CREATE TABLE `t_payment_method` (
  `pay_method` varchar(32) NOT NULL COMMENT '支付方法(wap-wap支付，app-app支付，qr-扫码付，f2f-扫码付，medicareOnline-在线医保支付，prepaidCard-预付卡支付，zero-零元支付，credit-信用卡支付，withhod-代扣支付)',
  `pay_channel` varchar(32) NOT NULL COMMENT '支付渠道(channel_info主键)',
  `remark` varchar(128) DEFAULT NULL COMMENT '支付方法说明',
  `ext_fields` varchar(1000) DEFAULT NULL COMMENT '扩展字段',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`pay_method`,`pay_channel`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='支付方法';

-- ----------------------------
-- Records of t_payment_method
-- ----------------------------

-- ----------------------------
-- Table structure for t_payment_mode
-- ----------------------------
DROP TABLE IF EXISTS `t_payment_mode`;
CREATE TABLE `t_payment_mode` (
  `pay_mode` varchar(64) NOT NULL COMMENT '支付方式（支付渠道+支付方法）',
  `pay_channel` varchar(32) DEFAULT NULL COMMENT '支付渠道',
  `pay_method` varchar(32) DEFAULT NULL COMMENT '支付方法',
  `pay_mode_name` varchar(100) DEFAULT NULL COMMENT '支付模式名称',
  `logo_uri` varchar(128) DEFAULT NULL COMMENT '支付log url',
  `remark` varchar(100) DEFAULT NULL COMMENT '支付模式说明',
  `ext_fields` varchar(1000) DEFAULT NULL COMMENT '扩展字段',
  `sort` tinyint(2) DEFAULT '1' COMMENT '排序',
  `type` int(1) DEFAULT NULL COMMENT '类型（1-云速商户展示）',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`pay_mode`),
  UNIQUE KEY `idx_model_channel_method` (`pay_channel`,`pay_method`) USING BTREE COMMENT '支付方式，渠道和方法索引'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='支付方式表';

-- ----------------------------
-- Records of t_payment_mode
-- ----------------------------

-- ----------------------------
-- Table structure for t_payment_order
-- ----------------------------
DROP TABLE IF EXISTS `t_payment_order`;
CREATE TABLE `t_payment_order` (
  `pay_order_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '支付订单号',
  `biz_order_id` bigint(50) DEFAULT NULL COMMENT '业务订单号',
  `his_id` bigint(20) DEFAULT NULL COMMENT '医院id',
  `his_name` varchar(200) DEFAULT NULL COMMENT '医院名称',
  `biz_channel` varchar(32) DEFAULT NULL COMMENT ' 业务平台来源',
  `biz_type` varchar(50) DEFAULT NULL COMMENT '业务类型',
  `pay_mode` varchar(32) DEFAULT NULL COMMENT '支付模式',
  `pay_channel` varchar(32) DEFAULT NULL COMMENT '支付渠道',
  `pay_method` varchar(32) DEFAULT NULL COMMENT '支付方法',
  `channel_user_id` varchar(128) DEFAULT NULL COMMENT '用户渠道id',
  `user_id` bigint(20) DEFAULT NULL COMMENT '用户Id',
  `goods_name` varchar(255) DEFAULT NULL COMMENT '商品名称',
  `total_fee` int(11) DEFAULT '0' COMMENT '订单金额',
  `fee` int(11) DEFAULT '0' COMMENT '现金金额',
  `medicare_fee` int(11) DEFAULT '0' COMMENT '医保报销金额',
  `discount_fee` int(11) DEFAULT '0' COMMENT '优惠金额',
  `real_total_fee` int(11) DEFAULT '0' COMMENT '实际支付金额',
  `effective_length` int(4) DEFAULT NULL COMMENT '支付时长(分钟)',
  `status` char(1) DEFAULT NULL COMMENT '状态（U-预登记 S-成功 I-未知 F-失败 O-已撤销）',
  `pay_serial_no` bigint(20) DEFAULT NULL COMMENT '支付流水号',
  `inside_merchant_id` bigint(20) DEFAULT NULL COMMENT '内部商户Id',
  `merchant_id` varchar(64) DEFAULT NULL COMMENT '商户号Id',
  `merchant_order_id` varchar(64) DEFAULT NULL COMMENT '支付渠道商户订单号',
  `pre_pay_no` varchar(64) DEFAULT NULL COMMENT '预支付Id',
  `payed_time` datetime DEFAULT NULL COMMENT '支付时间',
  `acquirer_serial_no` varchar(64) DEFAULT NULL COMMENT '支付流水号',
  `bank` varchar(32) DEFAULT NULL COMMENT '支付银行',
  `bank_serial` varchar(32) DEFAULT NULL COMMENT '支付银行流水',
  `biz_content` varchar(1000) DEFAULT NULL COMMENT '业务传过来的内容',
  `is_med_pay` int(1) DEFAULT '0' COMMENT '是否只能医保支付（1-是 0-否）',
  `notice_biz_flag` int(1) DEFAULT '0' COMMENT '通知业务标志（0-未通知 1-已通知）',
  `ext_fields` varchar(1000) DEFAULT NULL COMMENT '扩展字段',
  `revoke_time` datetime DEFAULT NULL COMMENT '撤销,关闭,操作时间',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`pay_order_id`),
  UNIQUE KEY `idx_order_bizid_channel_type` (`biz_order_id`,`his_id`,`biz_channel`,`biz_type`) USING BTREE,
  KEY `idx_create_time` (`create_time`) USING BTREE COMMENT '时间索引'
) ENGINE=InnoDB AUTO_INCREMENT=146 DEFAULT CHARSET=utf8 COMMENT='支付订单表';

-- ----------------------------
-- Records of t_payment_order
-- ----------------------------

-- ----------------------------
-- Table structure for t_payment_serial
-- ----------------------------
DROP TABLE IF EXISTS `t_payment_serial`;
CREATE TABLE `t_payment_serial` (
  `pay_serial_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '支付流水号',
  `pay_order_id` bigint(20) NOT NULL COMMENT '支付订单号',
  `pay_mode` varchar(32) DEFAULT NULL COMMENT '支付方式',
  `pay_channel` varchar(32) DEFAULT NULL COMMENT '支付渠道',
  `pay_method` varchar(32) DEFAULT NULL COMMENT '支付方法',
  `total_fee` int(11) DEFAULT '0' COMMENT '总金额',
  `medicare_fee` int(11) DEFAULT '0' COMMENT '医保部分金额',
  `discount_fee` int(11) DEFAULT '0' COMMENT '支付扣减金额',
  `fee` int(11) DEFAULT '0' COMMENT '自费部分金额',
  `status` char(1) DEFAULT NULL COMMENT '状态（U-预登记 S-成功 I-未知 F-失败 O-已撤销 C-超时关闭 R-退款）',
  `over_time` datetime DEFAULT NULL COMMENT '支付超时时间',
  `inside_merchant_id` bigint(20) DEFAULT NULL COMMENT '内部商户Id',
  `merchant_id` varchar(64) DEFAULT NULL COMMENT '商户号',
  `merchant_order_id` varchar(32) DEFAULT NULL COMMENT '商户订单Id',
  `pre_pay_no` varchar(2000) DEFAULT NULL COMMENT '预支付Id',
  `payed_time` datetime DEFAULT NULL COMMENT '支付时间',
  `acquire_serial_no` varchar(64) DEFAULT NULL COMMENT '支付渠道流水',
  `bank` varchar(32) DEFAULT NULL COMMENT '支付银行',
  `bank_serial_no` varchar(32) DEFAULT NULL COMMENT '银行流水',
  `channel_user_id` varchar(128) DEFAULT NULL COMMENT '支付渠道用户ID',
  `medical_card_id` varchar(100) DEFAULT NULL COMMENT '诊疗证编号',
  `med_response_content` varchar(1000) DEFAULT NULL COMMENT '医保支付返回内容',
  `ext_fields` varchar(1000) DEFAULT NULL COMMENT '扩展字段',
  `revoke_time` datetime DEFAULT NULL COMMENT '撤销,关闭,操作时间',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`pay_serial_id`),
  KEY `idx_uniq_serial_morderid` (`merchant_order_id`) USING BTREE COMMENT '商户订单号唯一索引'
) ENGINE=InnoDB AUTO_INCREMENT=150 DEFAULT CHARSET=utf8 COMMENT='支付流水表';

