-- ----------------------------
-- Table structure for t_payment_sync_log
-- ----------------------------
DROP TABLE IF EXISTS `t_payment_sync_log`;
CREATE TABLE `t_payment_sync_log` (
  `log_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `his_id` bigint(20) DEFAULT NULL COMMENT '受理方ID',
  `pay_order_id` bigint(20) DEFAULT NULL COMMENT '支付订单号',
  `node_code` varchar(20) DEFAULT NULL COMMENT '同步方code(pay_result-订单支付结果)',
  `node_name` varchar(50) DEFAULT NULL COMMENT '节点名称',
  `sync_time` datetime DEFAULT NULL COMMENT '同步时间',
  `times` int(11) DEFAULT '0' COMMENT '已经执行次数',
  `max_times` int(11) DEFAULT '0' COMMENT '最大重试次数',
  `next_execute_time` datetime DEFAULT NULL COMMENT '下次执行时间',
  `status` int(20) DEFAULT '0' COMMENT '状态(0-未成功 1-成功)',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `ext_fields` varchar(500) DEFAULT NULL COMMENT '扩展字段',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`log_id`),
  UNIQUE KEY `idx_sync_payorderid` (`pay_order_id`,`his_id`,`node_code`) USING BTREE COMMENT '订单code唯一索引',
  KEY `idx_sync_scheduler` (`node_code`,`next_execute_time`,`status`) COMMENT '待同步数据查询'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='支付数据同步表';

-- ----------------------------
-- Records of t_payment_sync_log
-- ----------------------------
